import React from "react";
import { useNavigate } from "react-router-dom";
import "./index.css";

export default function BurnoutSurvey() {
  const navigate = useNavigate();

  const labels = [
    "Ï†ÑÌòÄÏóÜÎã§",
    "1ÎÖÑÏóê 2-3Ìöå ÎòêÎäî Í∑∏ ÎØ∏Îßå",
    "Ìïú Îã¨Ïóê Ìïú Î≤à ÎòêÎäî Í∑∏ ÎØ∏Îßå",
    "Ìïú Îã¨Ïóê 2-3Ìöå",
    "ÏùºÏ£ºÏùºÏóê 1Ìöå Ï†ïÎèÑ",
    "ÏùºÏ£ºÏùºÏóê 2-3Ìöå",
    "Îß§Ïùº"
  ];

  const questions = [
    "Îß°ÏùÄ ÏùºÏùÑ ÌïòÎäî Îç∞ ÏûàÏñ¥ÏÑú Ï†ïÏÑúÏ†ÅÏúºÎ°ú Í≥†Í∞àÎêú ÎäêÎÇåÏù¥ Îì†Îã§.",
    "ÏùºÏùÑ ÎßàÏπòÍ≥† Ìá¥Í∑ºÌï† ÎïåÏØ§Ïù¥Î©¥ Í∏∞ÏßÑÎß•ÏßÑÌïú ÎäêÎÇåÏù¥ Îì†Îã§.",
    "ÏïÑÏπ®Ïóê ÏùºÏñ¥ÎÇòÏÑú Îã§Ïãú Ï∂úÍ∑ºÌï† ÏÉùÍ∞ÅÏùÑ ÌïòÎ©¥ ÌîºÍ≥§Ìïú ÎäêÎÇåÏù¥ Îì†Îã§.",
    "ÌïòÎ£® Ï¢ÖÏùº ÏùºÌïòÎäî Í≤ÉÏùÄ ÎÇòÎ•º Í∏¥Ïû•ÏãúÌÇ®Îã§.",
    "ÎÇòÎäî ÏßÅÎ¨¥ÏÉÅ Î∞úÏÉùÌïòÎäî Î¨∏Ï†úÎì§ÏùÑ Ìö®Í≥ºÏ†ÅÏúºÎ°ú Ìï¥Í≤∞ÌïúÎã§.",
    "Ïùº ÎïåÎ¨∏Ïóê ÏÜåÏßÑÎêú ÏÉÅÌÉúÏù¥Îã§.",
    "ÏßÅÏû•Ïóê Ìö®Í≥ºÏ†ÅÏù∏ Í∏∞Ïó¨Î•º ÌïòÍ≥† ÏûàÎã§Í≥† ÎäêÎÇÄÎã§.",
    "Ïù¥ ÏùºÏùÑ ÏãúÏûëÌïú Ïù¥ÌõÑÎ°ú ÎÇ¥ ÏùºÏóê ÎåÄÌïú Í¥ÄÏã¨Ïù¥ Ï§ÑÏóàÎã§.",
    "Îß°ÏùÄ ÏùºÏùÑ ÌïòÎäîÎç∞ ÏûàÏñ¥ÏÑú ÏÜåÍ∑πÏ†ÅÏù¥ ÎêòÏóàÎã§.",
    "ÎÇ¥Í∞Ä ÏÉùÍ∞ÅÌï† Îïå, ÎÇòÎäî ÏùºÏùÑ ÏûòÌïúÎã§.",
    "ÏßÅÎ¨¥ÏÉÅ Î¨¥Ïñ∏Í∞ÄÎ•º ÏÑ±Ï∑®ÌñàÏùÑ Îïå Í∏∞ÏÅ®ÏùÑ ÎäêÎÇÄÎã§.",
    "ÎÇòÎäî ÌòÑÏû¨Ïùò ÏßÅÎ¨¥ÏóêÏÑú Í∞ÄÏπò ÏûàÎäî ÎßéÏùÄ Í≤ÉÏùÑ Ïù¥Î£®Ïñ¥ÏôîÎã§.",
    "ÎÇòÎäî Î∞©Ìï¥Î∞õÏßÄ ÏïäÍ≥† ÎÇ¥ ÏùºÏùÑ ÏàòÌñâÌïòÍ∏∞ ÏõêÌï† ÎøêÏù¥Îã§.",
    "ÎÇ¥ ÏùºÏù¥ Î¨¥Ïñ∏Í∞ÄÏóê Í∏∞Ïó¨ÌïòÎì† ÎßêÎì† ÎÇòÎäî Ï†êÏ†ê Îçî ÎÉâÏÜåÏ†ÅÏù¥ ÎêòÏóàÎã§.",
    "ÎÇ¥ ÏùºÏùò Ï§ëÏöîÏÑ±Ïù¥ ÏùòÏã¨Ïä§ÎüΩÎã§.",
    "ÎÇòÎäî ÏùºÏùÑ Ìö®Í≥ºÏ†ÅÏúºÎ°ú Ï≤òÎ¶¨ÌïòÍ≥† ÏûàÎã§Îäî ÏûêÏã†Í∞êÏù¥ ÏûàÎã§."
  ];

  const handleSubmit = () => {
    const unanswered = questions.some((_, i) => {
      return !document.querySelector(`input[name='q${i}']:checked`);
    });

    if (unanswered) {
      alert("Î™®Îì† Î¨∏Ìï≠Ïóê ÏùëÎãµÌï¥Ïïº Í≤∞Í≥ºÎ•º Î≥º Ïàò ÏûàÏäµÎãàÎã§.");
      return;
    }

    const getValue = (i) => {
      const selected = document.querySelector(`input[name='q${i}']:checked`);
      return selected ? parseInt(selected.value, 10) : 0;
    };

    const exhaustionIdx = [0, 1, 2, 3, 5];              // ÏÜåÏßÑ: 1, 2, 3, 4, 6
    const depersonalIdx = [7, 8, 12, 13, 14];           // ÎÉâÏÜå: 8, 9, 13, 14, 15
    const efficacyIdx = [4, 6, 9, 10, 11, 15];          // Ìö®Îä•Í∞ê: 5, 7, 10, 11, 12, 16

    const exhaustionSum = exhaustionIdx.reduce((sum, i) => sum + getValue(i), 0);
    const depersonalSum = depersonalIdx.reduce((sum, i) => sum + getValue(i), 0);
    const efficacySum = efficacyIdx.reduce((sum, i) => sum + getValue(i), 0);

    const exhaustionMean = exhaustionSum / exhaustionIdx.length;
    const depersonalMean = depersonalSum / depersonalIdx.length;
    const efficacyMean = efficacySum / efficacyIdx.length;

    // ÏïÑÎûò T Ï†êÏàòÎäî ÏõêÎûò ÏûàÎçò Í≥ÑÏÇ∞ Î∞©Ïãù Ïú†ÏßÄ (ÏõêÌïòÎ©¥ Ï°∞Ï†ï Í∞ÄÎä•)
    const exhaustionT = 50 + 10 * (exhaustionMean - 2.26) / 1.47;    ;
    const depersonalT = 50 + 10 * (depersonalMean - 1.74) / 1.36;    ;
    const efficacyT = 50 + 10 * (efficacyMean - 4.34) / 1.17;

    navigate("/result", {
      state: {
        exhaustionSum,
        exhaustionMean,
        depersonalSum,
        depersonalMean,
        efficacySum,
        efficacyMean,
        exhaustionT,
        depersonalT,
        efficacyT
      }
    });
  };  

  return (
    <div className="burnout-container">
      <main className="burnout-main">
        <section className="burnout-section">
          <h2 className="burnout-title">üìã MBI GS ÏÑ§Î¨∏ÏßÄ</h2>
          <p className="burnout-instruction">
            Îã§Ïùå ÏßàÎ¨∏Ïóê 0ÏóêÏÑú 6 ÏÇ¨Ïù¥Ïùò Ï†êÏàòÎ°ú ÎãµÌï¥Ï£ºÏÑ∏Ïöî.<br />
            (0: Ï†ÑÌòÄÏóÜÎã§, 1: 1ÎÖÑÏóê 2-3Ìöå ÎòêÎäî Í∑∏ ÎØ∏Îßå, 2: Ìïú Îã¨Ïóê Ìïú Î≤à ÎòêÎäî Í∑∏ ÎØ∏Îßå,
            3: Ìïú Îã¨Ïóê 2-3Ìöå, 4: ÏùºÏ£ºÏùºÏóê 1Ìöå Ï†ïÎèÑ, 5: ÏùºÏ£ºÏùºÏóê 2-3Ìöå, 6: Îß§Ïùº)
          </p>
          {questions.map((q, idx) => (
            <div key={idx} className="burnout-question-card">
              <h3>{idx + 1}. {q}</h3>
              <div className="burnout-options">
                {labels.map((label, i) => (
                  <label key={i} className="burnout-option">
                    <input type="radio" name={`q${idx}`} value={i} />
                    {i} - {label}
                  </label>
                ))}
              </div>
            </div>
          ))}
          <div className="burnout-button-center">
            <button className="burnout-button" onClick={handleSubmit}>Í≤∞Í≥º Î≥¥Í∏∞</button>
          </div>
        </section>
      </main>
    </div>
  );
}
